import React, { Component } from 'react';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Typography from '@material-ui/core/Typography';
import { CardActionArea } from '@material-ui/core';
import { flexbox } from '@material-ui/system';
class Top5 extends Component {

    render() {
        const top5_=this.props.top5.map(state_data=>
            <div key={state_data.States}>
        <Card variant="outlined" className="margin10">
            <CardContent>{state_data.Cured}</CardContent>
            <CardContent>{state_data.Cured}</CardContent>
            <CardActions>{state_data.Cured}</CardActions>
        </Card>
        </div>

        );
        return (
            <div>
                {top5_}
            </div>
        );
    }
}

export default Top5;
